#include<iostream>
#include<string>
#include<cstring>

using namespace std;

void draw(int px, int py, int len);
void print();

const int LEN = 32;

string s;
int idx,sum;
int grid[LEN][LEN];

int main()
{
	//freopen("input.txt","r",stdin);
	//freopen("output.txt","w",stdout);
	int n;
	cin >> n;
	while (n--)
	{
		memset(grid, 0, sizeof(grid));
		sum = 0;
		int cnt = 2;
		while (cnt--)
		{
			idx = 0;
			cin >> s;
			draw(0, 0, LEN);
		}
		cout << "There are " << sum << " black pixels.\n";
	}
	return 0;
}

//计算以(px,py)为起点，长度为len的正方形灰度
void draw(int px,int py,int len)
{
	int L = len / 2;
	char ch = s[idx++];
	if (ch == 'p')
	{
		draw(px + L, py,L);
		draw(px, py, L);
		draw(px, py + L, L);
		draw(px + L, py + L, L);
	}
	else if (ch == 'f')
	{
		for (int i = px; i < px + len; i++)
		{
			for (int j = py; j < py + len; j++)
			{
				if (grid[i][j] != 1)
				{
					sum++;					
					grid[i][j] = 1;
				}
			}
		}
	}
	return;
}

void print()
{
	for (int i = 0; i < LEN; i++)
	{
		for (int j = 0; j < LEN; j++)
		{
			if (grid[i][j] == 1)
				cout << "*";
			else
				cout << " ";
		}
		cout << endl;
	}
}

